import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

const About = () => {
  const [displayText, setDisplayText] = useState('');
  const fullText = "Computer Science graduate with 2+ years of experience in software quality assurance and frontend development. Proven track record of reducing bugs by 85% and improving user satisfaction. Seeking opportunities to contribute to innovative teams and deliver high-quality software solutions.";

  useEffect(() => {
    let index = 0;
    const timer = setInterval(() => {
      if (index < fullText.length) {
        setDisplayText(fullText.slice(0, index + 1));
        index++;
      } else {
        clearInterval(timer);
      }
    }, 50);

    return () => clearInterval(timer);
  }, []);

  return (
    <section className="py-32 px-4 relative overflow-hidden">
      {/* 3D Floating Background Elements */}
      <div className="absolute inset-0">
        {[...Array(15)].map((_, i) => (
          <motion.div
            key={i}
            className="absolute rounded-full opacity-20"
            style={{
              width: `${Math.random() * 200 + 100}px`,
              height: `${Math.random() * 200 + 100}px`,
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              background: `radial-gradient(circle, ${[
                'rgba(201, 176, 55, 0.2)',
                'rgba(230, 230, 250, 0.2)',
                'rgba(184, 134, 11, 0.2)'
              ][Math.floor(Math.random() * 3)]} 0%, transparent 70%)`,
              filter: 'blur(3px)'
            }}
            animate={{
              y: [-50, 50, -50],
              x: [-30, 30, -30],
              scale: [1, 1.3, 1],
              rotate: [0, 360],
            }}
            transition={{
              duration: 15 + Math.random() * 10,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          />
        ))}
      </div>

      <div className="max-w-6xl mx-auto relative z-10">
        <motion.h2 
          className="text-6xl md:text-8xl font-black text-center mb-20 ultra-sharp"
          initial={{ opacity: 0, y: 100, rotateX: -90 }}
          whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
          transition={{ duration: 1.5, ease: "easeOut" }}
          viewport={{ once: true }}
        >
          <span className="holo-text neon-text float-3d animate-premium-glow">
            About Me
          </span>
          {/* Enhanced glow layers */}
          <motion.div
            className="absolute inset-0 opacity-30 blur-lg"
            style={{
              background: 'linear-gradient(45deg, #c9b037, #e6e6fa, #b8860b, #daa520)',
              backgroundClip: 'text',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent'
            }}
            animate={{ opacity: [0.2, 0.5, 0.2] }}
            transition={{ duration: 3, repeat: Infinity }}
          >
            About Me
          </motion.div>
        </motion.h2>

        <div className="max-w-4xl mx-auto text-center">
          {/* Enhanced Typing Animation */}
          <motion.div
            className="electric-border holo-card p-8 rounded-2xl backdrop-blur-xl transform-gpu animate-premium-pulse mb-8"
            whileHover={{ 
              scale: 1.05,
              rotateY: 8,
              boxShadow: '0 30px 80px rgba(201, 176, 55, 0.4), 0 0 100px rgba(230, 230, 250, 0.3)'
            }}
          >
            <div className="text-2xl text-white leading-relaxed min-h-[150px] ultra-sharp">
              <span className="holo-text animate-premium-glow">{displayText}</span>
              <motion.span
                className="inline-block w-1 h-8 bg-premium-gold ml-2 electric-border animate-premium-pulse"
                animate={{ opacity: [1, 0, 1] }}
                transition={{ duration: 1, repeat: Infinity }}
              />
            </div>
          </motion.div>

          {/* 3D Key Points */}
          <div className="grid md:grid-cols-2 gap-6 mb-8">
            {[
              { icon: "ðŸŽ¯", text: "2+ Years QA Experience with Manual & Automated Testing", color: "premium-gold" },
              { icon: "ðŸ’»", text: "Frontend Development: React, JavaScript, HTML/CSS", color: "champagne" },
              { icon: "ðŸ”", text: "Bug Detection & Resolution: 500+ Issues Resolved", color: "lavender-mist" },
              { icon: "ðŸš€", text: "Team Collaboration & Agile Methodologies", color: "antique-gold" }
            ].map((item, index) => (
              <motion.div
                key={index}
                className="electric-border holo-card p-6 rounded-xl backdrop-blur-xl transform-gpu animate-premium-pulse"
                initial={{ opacity: 0, y: 50, rotateX: -30 }}
                whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
                transition={{ delay: index * 0.2, duration: 0.8 }}
                viewport={{ once: true }}
                whileHover={{ 
                  scale: 1.08, 
                  rotateY: 12,
                  boxShadow: `0 25px 50px rgba(${item.color === 'premium-gold' ? '201, 176, 55' : item.color === 'champagne' ? '247, 231, 206' : item.color === 'lavender-mist' ? '230, 230, 250' : '184, 134, 11'}, 0.5)`
                }}
              >
                <div className="flex items-center space-x-6">
                  <motion.span 
                    className="text-5xl"
                    whileHover={{ scale: 1.4, rotate: 15 }}
                    transition={{ duration: 0.3 }}
                  >
                    {item.icon}
                  </motion.span>
                  <span className={`text-${item.color} text-lg font-bold ultra-sharp animate-premium-glow`}>{item.text}</span>
                </div>
              </motion.div>
            ))}
          </div>

          {/* Enhanced 3D Goal Statement */}
          <motion.div
            className="electric-border holo-card p-8 rounded-2xl backdrop-blur-xl transform-gpu animate-premium-pulse"
            initial={{ opacity: 0, scale: 0.8, rotateY: -30 }}
            whileInView={{ opacity: 1, scale: 1, rotateY: 0 }}
            transition={{ delay: 1, duration: 1.2 }}
            viewport={{ once: true }}
            whileHover={{
              scale: 1.06,
              rotateY: 8,
              boxShadow: '0 40px 100px rgba(201, 176, 55, 0.5), 0 0 120px rgba(230, 230, 250, 0.4)'
            }}
          >
            <h3 className="text-3xl font-black holo-text mb-6 animate-premium-glow">Career Objective</h3>
            <p className="text-white text-xl leading-relaxed ultra-sharp">
              To leverage my expertise in software quality assurance and frontend development 
              to contribute to a dynamic team, ensuring delivery of robust, user-friendly applications 
              while continuously growing my technical skills in a challenging environment.
            </p>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
